enum ScreenType {
  WELCOME = "welcome",
  CHAT = "chat",
  TESTE = "teste",
  FORNECEDORESFAVORITOS = "fornecedoresfavoritos",
  PAGINAINICIAL = "paginainicial"
}

export default ScreenType;
